import React from 'react';
import './RoomBooking.css';

const Profile = ({ user, onNavigate, onLogout }) => {
  const handleBack = () => {
    const email = user?.email || '';
    if (email.endsWith('@kkumail.com')) {
      onNavigate && onNavigate('booking');
    } else {
      onNavigate && onNavigate('dashboard');
    }
  };

  return (
    <div className="room-booking-layout">
      <header className="booking-header">
        <div className="header-content">
          <div className="logo-section">
            <img src="/logo/enkku_logo.png" alt="Logo" className="header-logo" />
            <h1>Profile</h1>
          </div>

          <div className="user-section">
            <div className="user-info">
              <i className="fa-solid fa-user profileIcon"></i>
              <span className='profileIcon'>{user?.first_name} {user?.last_name}</span>
            </div>
            <button className="logout-btn" onClick={onLogout}>
              <i className="fa-solid fa-right-from-bracket"></i>
              Logout
            </button>
          </div>
        </div>

        <button className="request-btn-main" onClick={handleBack}>
          Back
        </button>
      </header>

      <div className="section">
        <div className="section-title">User Profile</div>
        <div style={{ padding: '16px' }}>
          <p><strong>First name:</strong> {user?.first_name || '-'}</p>
          <p><strong>Last name:</strong> {user?.last_name || '-'}</p>
          <p><strong>Email:</strong> {user?.email || '-'}</p>
          <p><strong>Role:</strong> {user?.role || '-'}</p>
        </div>
      </div>
    </div>
  );
};

export default Profile;
